command.post_template:
{assign var="_private_ip" value=""}

{foreach $params.private_ips as $p_ip}
  {if $p_ip.ip != ''}
    {assign var="_private_ip" value="{$p_ip.ip}"}
  {/if}
{/foreach}

{assign_object_variable var="Network_interfaces" value="{$params.object_id} - {$_private_ip} - {$params.status}"}

{assign_object_variable var="private_ip" value={$_private_ip}}

{if  $params.status == 'available' }
      {assign_object_variable var="_color" value=green}
{/if}
{if  $params.status == 'in-use' }
      {assign_object_variable var="_color" value=blue}
{/if}
